import React from 'react';
import '../style/nav.css';
import {Link} from 'react-router-dom';
const nav = () => {
  const navStyle ={
    color: 'Black'
  };
  return (
    <div>
    <nav>
    <ul class="container-nav">
    <li><a href="#achievementsContainer">Achievements</a></li>
    <li><a href="#About">About</a></li>
    <li><h2>Frsah</h2></li>
    <Link to={'/SignUp'}>
    <li>SignIn/SignUp</li>
    </Link>
    <li><a href="#Services">Services</a></li>
    </ul>
    </nav>
    </div>
  )
}

export default nav
